//import codeSymbol from './../../public/codeSymbol*.png'

const Home = () => {
    return ( 
    <div className = {classes.Home}>
        <div className = {classes.Container}>
            <h1 className = {classes.Hello}>Hello, world.</h1>
            <h1>Welcome to my website</h1>
        </div>
        <img className = {classes.Code} src = {codeSymbol} ></img>
    </div>
     );
}

export default Home;
